import React, { Component } from 'react'

export default class App extends Component {

  constructor(props) {
    super(props);
    this.state = {text: "显示数据"};
    this.handleClick = this.handleClick.bind(this);
  }

  handleClick() {
    this.setState(state => ({
      text: "change text"
    }));
  }

  render() {
    return (
      <div>
         <button onClick={this.handleClick}>获取原生数据</button>
      </div>
    )
  }
}
